INSERT INTO `shop_products` (`id`, `cate_id`, `cate_name`, `name`, `alias`, `info`, `description`, `image`, `price`, `barcode`, `quantity`, `is_sale_off`, `discount`, `total_buy`, `is_popular`, `page`, `status`, `create_date`) VALUES
(1, 7, 'BBCream - Kem Nền', 'CC Cream Thefaceshop Aqua UV Color Control Cream SPF50/PA++', 'CC-Cream-Thefaceshop-Aqua-UV-Color-Control-Cream-SPF50-PA--', 'Sau thành công của Face It Aura Color Control Cream ra mắt đầu năm nay, TFS vừa tung ra dòng CC cream mới tinh này với khả năng vượt bậc hơn', '<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;"><strong>CC Cream Thefaceshop Aqua UV Color Control Cream SPF50/PA++</strong> - 440.000</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Trọng Lượng: 20g</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Sau th&agrave;nh c&ocirc;ng của Face It Aura Color Control Cream ra mắt đầu năm nay, TFS vừa tung ra d&ograve;ng <a title="CC Cream Thefaceshop Aqua UV Color Control Cream SPF50/PA++" href="/shop/BBCream---Kem-Nen/CC-Cream-Thefaceshop-Aqua-UV-Color-Control-Cream-SPF50-PA--">CC cream</a>&nbsp;mới tinh n&agrave;y với khả năng vượt bậc hơn:</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">+ Chống nắng SPF 50+ hơn cả kem chống nắng hằng ng&agrave;y bảo vệ l&agrave;n da dưới nắng mặt trời.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">+ Chống thấm nước gi&uacute;p giữ lớp trang điểm cả ng&agrave;y d&agrave;i.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">+ Cơ chế l&agrave;m m&aacute;t mới gi&uacute;p giảm nhiệt cho da (giảm nhiệt bề mặt đến 2 độ C so với nhiệt độ cơ thể) th&iacute;ch hợp cho make up ban ng&agrave;y, thoải m&aacute;i ra nắng m&agrave; kh&ocirc;ng lo da bị bỏng r&aacute;t v&agrave; bị tia UV tấn c&ocirc;ng nữa.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">+ Chức năng c&acirc;n chỉnh m&agrave;u da, cho lớp nền đều m&agrave;u v&agrave; n&acirc;ng t&ocirc;ng da s&aacute;ng hơn một c&aacute;ch tự nhi&ecirc;n. Chất kem khi đ&aacute;nh l&ecirc;n da sẽ tự động chuyển m&agrave;u ph&ugrave; hợp với da bạn, c&acirc;n bằng những v&ugrave;ng s&aacute;ng tối tr&ecirc;n da v&agrave; che phủ khuyết điểm.</span></p>', '2014_01_17_16_50_17-shopmyphamhan-CC_Thefaceshop_xanh.jpg', 440000, 'CCTFS02', -11, '0', 0, 12, '1', '1', '1', 1385538227),
(2, 7, 'BBCream - Kem Nền', 'Face it magic cover BB CREAM', 'Face-it-magic-cover-BB-CREAM', 'Bạn có thể tìm thấy tại sản phẩm FACE IT MAGIC COVER BB CREAM SPF20 PA++  Kem lót trang điểm đa năng với công thức thông minh', '<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;"><strong>FACE it Magic Cover BB Cream SPF20 PA</strong>++ (45ml)</span></p>\r\n<p><br /><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Bạn c&oacute; thể t&igrave;m thấy tại sản phẩm <a title="Face it magic cover BB Cream" href="/shop/BBCream---Kem-Nen/Face-it-magic-cover-BB-CREAM"><strong>FACE IT MAGIC COVER BB CREAM SPF20 PA++</strong></a> Kem l&oacute;t trang điểm đa năng với c&ocirc;ng thức th&ocirc;ng minh, chứa c&aacute;c hạt dưỡng chất DNA được bao bọc bởi lớp m&agrave;ng bảo vệ sẽ tự động k&iacute;ch hoạt v&agrave; thẩm thấu chất chống oxy h&oacute;a (Vitamin C, E) v&agrave;o da khi da tiếp x&uacute;c với &aacute;nh nắng mặt trời.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;"> Đồng thời, nhờ th&agrave;nh phần Dolwoe v&agrave; L&ecirc; Rừng trong sản phẩm gi&uacute;p l&agrave;m trắng v&agrave; ngăn ngừa c&aacute;c dấu hiệu l&atilde;o h&oacute;a sớm, duy tr&igrave; sự tươi s&aacute;ng v&agrave; rạng rỡ l&acirc;u d&agrave;i cho da.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span class="fbPhotosPhotoCaption" data-ft="{"><img title="Face It Magic Cover BB Cream" src="http://thuylinhshop.com/Images_upload/images/1322575942_Magic_cover_BB_zpscbae24e3.jpg" alt="" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<a title="Face it magic cover BB Cream" href="/shop/BBCream---Kem-Nen/Face-it-magic-cover-BB-CREAM"><img title="Face It Magic Cover BB Cream" src="http://thuylinhshop.com/Images_upload/images/841_P_1350541180147.jpg" alt="" /></a></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2014_01_17_16_40_17-shopmyphamhan-Face-it-magic-cover-BB-CREAM.png', 300000, 'BBTFS04', -2, '1', 10, 3, '1', '1', '1', 1385538402),
(4, 3, 'BB Cream - CC Cream - Kem Nền', 'Red Bean BB Cream SPF 20 PA+ - BB Cream Skinfood Chiết Xuất Đậu Đỏ', 'Red-Bean-BB-Cream-SPF-20-PA----BB-Cream-Skinfood-Chiet-Xuat-Dau-Do', 'Đây là dòng sản phẩm BB Cream dành cho da thường, da hỗn hợp, với độ che phủ cao cùng mùi thơm nhẹ nhàng, dưỡng chất tốt, BB Cream đậu đỏ là sản phẩm không thể thiếu trong bộ sưu tập Skinfood.', '<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;" data-mce-mark="1">Đ&acirc;y l&agrave; d&ograve;ng sản phẩm BB Cream d&agrave;nh cho da thường, da hỗn hợp, với độ che phủ cao c&ugrave;ng m&ugrave;i thơm nhẹ nh&agrave;ng, dưỡng chất tốt, BB Cream đậu đỏ l&agrave; sản phẩm kh&ocirc;ng thể thiếu trong bộ sưu tập Skinfood.</span></p>\r\n<p style="text-align: center;"><span style="font-family: arial, helvetica, sans-serif; font-size: small;" data-mce-mark="1"><img title="Red Bean BB Cream SPF 20 PA+ - BB Cream Skinfood Chiết Xuất Đậu Đỏ" src="/uploads/details/Products/img_prod/bb-dau-do.jpg" alt="Red Bean BB Cream SPF 20 PA+ - BB Cream Skinfood Chiết Xuất Đậu Đỏ" /></span></p>\r\n<p><br /><span style="font-family: arial, helvetica, sans-serif; font-size: small;">Red Bean BB Cream SPF 20 PA+ lỏng hơn so với c&aacute;c BB kh&aacute;c n&ecirc;n khi d&ugrave;ng, n&oacute; tạo một lớp kh&aacute; mỏng tr&ecirc;n bề mặt da, b&ecirc;n cạnh khả năng chống nắng, BB đậu đỏ c&oacute; một đặc điểm nữa l&agrave; kh&ocirc;ng bị xuống m&agrave;u sau thời gian d&agrave;i make up.</span></p>', '2014_01_17_16_26_24-shopmyphamhan-bb-dau-do-1.jpg', 240000, 'BBSF007', -3, '0', 0, 4, '1', '1', '1', 1385640330);
